import React, { useState } from 'react';
import axios from 'axios';

function PredictorForm() {
  const [departureAirport, setDepartureAirport] = useState('');
  const [arrivalAirport, setArrivalAirport] = useState('');
  const [departureDate, setDepartureDate] = useState('');
  const [departureTime, setDepartureTime] = useState('');
  const [airline, setAirline] = useState('');
  const [flightNumber, setFlightNumber] = useState('');
  const [weatherCondition, setWeatherCondition] = useState('');
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    if (!departureAirport || !arrivalAirport || !departureDate || !departureTime || !airline || !flightNumber) {
      setError('Please fill in all required fields.');
      setLoading(false);
      return;
    }

    const payload = {
      departure_airport: departureAirport,
      arrival_airport: arrivalAirport,
      departure_date: departureDate,
      departure_time: departureTime,
      airline: airline,
      flight_number: flightNumber,
      weather_condition: weatherCondition,
    };

    try {
      const response = await axios.post('http://localhost:8000/predict', payload);
      setPrediction(response.data);
      setLoading(false);
    } catch (error) {
      setError("Error in prediction. Please try again.");
      setLoading(false);
    }
  };

  return (
    <div className="container my-5">
      <div className="card shadow-sm">
        <div className="card-body">
          <h1 className="text-center mb-4">Flight Delay Prediction</h1>
          <p className="text-center">Enter your flight details to predict possible delays.</p>

          {error && <div className="alert alert-danger text-center">{error}</div>}

          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label">Flight Number <span className="text-danger">*</span></label>
              <input
                type="text"
                className="form-control"
                placeholder="e.g., AA1234"
                value={flightNumber}
                onChange={(e) => setFlightNumber(e.target.value)}
                required
              />
            </div>

            <div className="mb-3">
              <label className="form-label">Departure Airport <span className="text-danger">*</span></label>
              <input
                type="text"
                className="form-control"
                placeholder="e.g., JFK"
                value={departureAirport}
                onChange={(e) => setDepartureAirport(e.target.value)}
                required
              />
            </div>

            <div className="mb-3">
              <label className="form-label">Arrival Airport <span className="text-danger">*</span></label>
              <input
                type="text"
                className="form-control"
                placeholder="e.g., LAX"
                value={arrivalAirport}
                onChange={(e) => setArrivalAirport(e.target.value)}
                required
              />
            </div>

            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Departure Date <span className="text-danger">*</span></label>
                <input
                  type="date"
                  className="form-control"
                  value={departureDate}
                  onChange={(e) => setDepartureDate(e.target.value)}
                  required
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Departure Time <span className="text-danger">*</span></label>
                <input
                  type="time"
                  className="form-control"
                  value={departureTime}
                  onChange={(e) => setDepartureTime(e.target.value)}
                  required
                />
              </div>
            </div>

            <div className="mb-3">
              <label className="form-label">Airline <span className="text-danger">*</span></label>
              <select
                className="form-select"
                value={airline}
                onChange={(e) => setAirline(e.target.value)}
                required
              >
                <option value="">Select Airline</option>
                <option value="American Airlines">American Airlines</option>
                <option value="Delta Airlines">Delta Airlines</option>
                <option value="United Airlines">United Airlines</option>
                <option value="Southwest Airlines">Southwest Airlines</option>
              </select>
            </div>

            <div className="mb-4">
              <label className="form-label">Weather Condition</label>
              <select
                className="form-select"
                value={weatherCondition}
                onChange={(e) => setWeatherCondition(e.target.value)}
              >
                <option value="">Select Condition</option>
                <option value="Clear">Clear</option>
                <option value="Rainy">Rainy</option>
                <option value="Snowy">Snowy</option>
                <option value="Foggy">Foggy</option>
                <option value="Stormy">Stormy</option>
              </select>
            </div>

            <button type="submit" className="btn btn-primary w-100" disabled={loading}>
              {loading ? "Predicting..." : "Predict Delay"}
            </button>
          </form>

          {prediction && (
            <div className="mt-4">
              <h3 className="text-center">Prediction Result</h3>
              <p className="text-center">Prediction: {prediction.prediction === 1 ? 'Delayed' : 'On Time'}</p>
              <p className="text-center">Probability of Delay: {(prediction.probability_of_delay * 100).toFixed(2)}%</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default PredictorForm;
